import React, { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  Box, Container, Typography, Button, Paper, 
  Table, TableBody, TableCell, TableContainer, 
  TableHead, TableRow, CircularProgress, Alert,
  Chip, IconButton
} from '@mui/material';
import { 
  Add as AddIcon,
  School as SchoolIcon
} from '@mui/icons-material';

const DepartmentList = () => {
  const [departments, setDepartments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDepartments = async () => {
      try {
        // Mock data for now - replace with actual API call when available
        const mockDepartments = [
          { id: 1, name: 'Computer Science', head: 'Dr. Alan Turing', foundedYear: 1985, status: 'ACTIVE', studentsCount: 120, coursesCount: 15 },
          { id: 2, name: 'Mathematics', head: 'Dr. Ada Lovelace', foundedYear: 1950, status: 'ACTIVE', studentsCount: 85, coursesCount: 12 },
          { id: 3, name: 'Physics', head: 'Dr. Richard Feynman', foundedYear: 1960, status: 'ACTIVE', studentsCount: 65, coursesCount: 10 },
          { id: 4, name: 'Biology', head: 'Dr. Jane Goodall', foundedYear: 1970, status: 'ACTIVE', studentsCount: 90, coursesCount: 14 },
          { id: 5, name: 'History', head: 'Dr. Howard Zinn', foundedYear: 1955, status: 'INACTIVE', studentsCount: 40, coursesCount: 8 },
          { id: 6, name: 'English', head: 'Dr. Maya Angelou', foundedYear: 1965, status: 'ACTIVE', studentsCount: 75, coursesCount: 9 },
        ];
        setDepartments(mockDepartments);
        setLoading(false);
      } catch (err) {
        console.error('Error loading departments:', err);
        setError('Failed to load departments. Please try again.');
        setLoading(false);
      }
    };

    fetchDepartments();
  }, []);

  const getStatusColor = (status) => {
    return status === 'ACTIVE' ? 'success' : 'error';
  };

  return (
    <Box className="page-container">
      <Container maxWidth="xl">
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
          <Typography variant="h4" component="h1">
            Departments
          </Typography>
          <Button
            variant="contained"
            color="primary"
            startIcon={<AddIcon />}
            component={RouterLink}
            to="/departments/new"
          >
            Add New Department
          </Button>
        </Box>

        {error && (
          <Alert severity="error" sx={{ mb: 3 }}>
            {error}
          </Alert>
        )}

        {loading ? (
          <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
            <CircularProgress />
          </Box>
        ) : departments.length === 0 ? (
          <Alert severity="info">No departments found. Add a new department to get started.</Alert>
        ) : (
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell></TableCell>
                  <TableCell>Name</TableCell>
                  <TableCell>Department Head</TableCell>
                  <TableCell>Founded</TableCell>
                  <TableCell>Students</TableCell>
                  <TableCell>Courses</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {departments.map((department) => (
                  <TableRow key={department.id}>
                    <TableCell>
                      <IconButton disabled sx={{ color: 'primary.main' }}>
                        <SchoolIcon />
                      </IconButton>
                    </TableCell>
                    <TableCell><strong>{department.name}</strong></TableCell>
                    <TableCell>{department.head}</TableCell>
                    <TableCell>{department.foundedYear}</TableCell>
                    <TableCell>{department.studentsCount}</TableCell>
                    <TableCell>{department.coursesCount}</TableCell>
                    <TableCell>
                      <Chip 
                        label={department.status} 
                        color={getStatusColor(department.status)} 
                        size="small" 
                      />
                    </TableCell>
                    <TableCell>
                      <Button
                        component={RouterLink}
                        to={`/departments/${department.id}`}
                        size="small"
                        sx={{ mr: 1 }}
                      >
                        View
                      </Button>
                      <Button
                        component={RouterLink}
                        to={`/departments/${department.id}/edit`}
                        size="small"
                        color="primary"
                      >
                        Edit
                      </Button>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        )}
      </Container>
    </Box>
  );
};

export default DepartmentList;
